import React from 'react';

const ContactPageFilter = () => {

    return(
        <div className="leftContainer">

            {/* text describing the below search filter */}
            <div className="textContainer">
                <p className="filterHeader"> 1.Kies de professional </p>

                <p className="filterText">
                    Uit de onderstaande lijst kunt u een professional
                    <br />
                    kiezen die u een bericht wilt sturen.
                </p>
            </div>

            <div className="filterContainer">
                {/* this form lets the user filter the search */}
                <form className="formContainer">
                    <input placeholder="Type hier je zoekopdracht" className="placeText"/>
                    <input placeholder="Filter op professie" className="placeText"/>
                </form>


                {/* displays the list of professional according to the filter */}
                <div className="filteredList">
                    <p> B. Derksen, Fysiotherapeut

                        S. Duijf, Fysiotherapeut

                        D. Hillbrands, Fysiotherapeut

                        C. Visser, Dietiste

                        A. Zeeyw, Logopedist

                        M. de Wit, Oefentherapeut

                        B. Derksen, Fysiotherapeut

                        C. Visser, Dietiste
                    </p>
                </div>

            </div>

        </div>
    );
};

export default ContactPageFilter;
